import "./paciente.css";

function App() {
  return (
    <div className="Paciente">
      <header className="Paciente-header">
        <img
          src={Pacientelogo}
          className="Paciente-logo"
          alt="paciente-logo"
        />
        <p>
          {" "}
          Edit <code> src / paciente.js </code> and save to reload.
        </p>
      </header>
    </div>
  );
}

export default Paciente;
